import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Layout from '../../components/Layout/Layout';
import CardsPage from '../../containers /CardsPage/CardsPage';

class App extends Component {
	render() {
		return (
			<Layout>
				<h1>Rick & Morty</h1>
				<CardsPage />

				<h1>Rick & Morty</h1>

			</Layout>
		);
	}
}

export default App;
